import React from 'react';
import { Container,Row,Col} from 'react-bootstrap'
import './LandingPage.css';
import bg from './bg3.jpg';

const LandingPage = () =>{
    return(
        <Container>
            <Row>
                <Col><img src={bg}/></Col>
                <Col>
                    hi
                </Col>
            </Row>
        </Container>
        
    )
}

export default LandingPage;
